        people killed, at least 233 injured and many buildings damaged (VII) in the
        Mexicali area. Felt (VII) at Guadalupe Victoria and (V) at El Sauzal, Ensenada,
        Maneadero, Primo Tapia, San Felipe, Tecate and Tijuana. Felt (VI) at San Luis
        Rio Colorado, Sonora. Felt in much of Baja California and northwestern Sonora
        and as far as Aguascalientes, Ciudad Juarez and La Paz. About 28 km of surface
        faulting observed on the Borrego Fault southwest of Mexicali. Many buildings
        damaged (VII) at Calexico and Imperial, California. Felt (VII) at El Centro
        and Heber; (VI) at Brawley, Calipatria, Holtville and Ocotillo; (V) at Borrego
        Springs, Boulevard, Campo, Chula Vista, Coachella, Coronado, Jacumba, Lemon
        Grove, Los Angeles, Niland, Pine Valley, San Diego, San Ysidro, Tecate, Thermal,
        Westmorland and Winterhaven. Felt (V) at Somerton, Wellton and Yuma, Arizona.
        Felt throughout southern California, in much of Arizona, in the Henderson-Las
        Vegas area, Nevada and in parts of New Mexico and Utah.\"}}}],\"losspager\":[{\"indexid\":\"132664891\",\"indexTime\":1485906048641,\"id\":\"urn:usgs-product:us:losspager:ci14607652:1485906008859\",\"type\":\"losspager\",\"code\":\"ci14607652\",\"source\":\"us\",\"updateTime\":1485906008859,\"status\":\"UPDATE\",\"properties\":{\"alertlevel\":\"red\",\"depth\":\"9.99\",\"eventsource\":\"ci\",\"eventsourcecode\":\"14607652\",\"eventtime\":\"2010-04-04T22:40:42.000Z\",\"latitude\":\"32.2862\",\"longitude\":\"-115.295\",\"magnitude\":\"7.2\",\"maxmmi\":\"9.0\"},\"preferredWeight\":51,\"contents\":{\"alertecon.pdf\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906008000,\"length\":10746,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertecon.pdf\"},\"alertecon.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906007000,\"length\":15749,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertecon.png\"},\"alertecon_small.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906007000,\"length\":8762,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertecon_small.png\"},\"alertecon_smaller.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906007000,\"length\":4832,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertecon_smaller.png\"},\"alertfatal.pdf\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906007000,\"length\":10505,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertfatal.pdf\"},\"alertfatal.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1485906007000,\"length\":15658,\"url\":\"https://earthquake.usgs.gov/archive/product/losspager/ci14607652/us/1485906008859/alertfatal.png\"},\"alertfatal_small.png\":{\"conten